class Solution(object):
    def findMaxConsecutiveOnes(self, nums):
        print(set(nums))
        cnt = 0
        max_count = 0
        for i in range(len(nums)):
            if nums[i] == 1:
                cnt += 1
                if i == len(nums)-1:  #edge case
                    if max_count < cnt:
                        max_count = cnt
                        cnt = 0

            elif nums[i] == 0:
                print(i)
                if max_count < cnt:
                    max_count = cnt
                cnt = 0

        return max_count
    
